/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import Nav from "../components/Nav";
import Dune from "../images/dune.jpg";
import React from "react";
import "./home.scss";
import CircleButton from "../components/CircleButton";

const tablet = `@media (max-width: 800px)`;
const mobile = `@media (max-width: 500px)`;

const HomeBackground = styled.div`
  background: url(${Dune}) no-repeat center center fixed;
  background-size: cover;
  font-size: 24px;
  color: white;
  font-weight: bold;
  bottom: 0;
  margin: 30px;
`;

const HomeDiv = styled.div`
  top: 200px;
  width: 150px;
  padding: 10px;
  border-style: solid;
  border-width: 2px;
  border-color: #aeff00;
  z-index: 4000;
`;

const DuneImg = styled.img`
  width: 1450px;
  right: 100px;
  position: absolute;
  border-right: 6px solid #aeff00;
  border-bottom: 6px solid #aeff00;
  ${tablet} {
    padding: 60px 40px;
  }
  ${mobile} {
    padding: 80px 0 80px 130px;
  }
`;

function Home() {
  return (
    <HomeBackground>
        <Nav />
        <HomeDiv> John Schriemer </HomeDiv>
        <DuneImg src={Dune} />
        <CircleButton />
    </HomeBackground>
  );
}

export default Home;
